ISLAMABAD, Jan 31 (APP):The 79 students of the Unversity of Central Punjab, Quaid-e-Azam Campus, Rawalpindi and provincial Minister for Agriculture and Provincial Minister of Balochistan Zmarak Khan Achakzai on Friday witnessed the proceedings of the Upper House of the Parliament.
Chairman Senate Sadiq Sanjrani welcomed the students and Zmarak Khan Achakzai.
